import logo from './logo.svg';
import './App.css';
//import MetronomeSound from '/public/drum_kit/Metronome.m4a';

const Metronome = () => {
    return <button>
       <audio src='public/drum_kit/Metronome.m4a' />
    </button>
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <h1 className="app-title">I am Drum Machine [┐∵]┘</h1>

        <div id="Metronome"> <Metronome /> </div>

        <p>
          En tempo-baserad trummaskin
        </p>
        <a
          className="app-link"
          href="https://ha-an.se"
          target="_blank"
        >
          Link to HA-AN
        </a>
      </header>
    </div>
  );
}

export default App;
